.circle-hover-wrapper {
  position: relative;
  z-index: 999;
  height: 100px;
  width: 100px;
  padding: 0;
}
.circle-hover-wrapper:hover {
  z-index: 800;
}
.circle-hover-wrapper:hover::before {
  position: absolute;
  content: "";
  height: 80%;
  width: 80%;
  border: 1px solid #5EDCD4;
  border-radius: 50%;
  -webkit-transform: translate(10px, -5px);
  -ms-transform: translate(10px, -5px);
  transform: translate(10px, -5px);
  pointer-events: none;
  opacity: 0.7;
}
@media (min-width: 960px) {
  .circle-hover-wrapper:hover {
    z-index: 800;
  }
  .circle-hover-wrapper:hover::before {
    height: 100%;
    width: 100%;
    -webkit-transform: scale(2);
    -ms-transform: scale(2);
    transform: scale(2);
  }
}

.circle-wrapper {
  position: relative;
  z-index: 999;
  height: 200px;
  width: 200px;
  padding: 0;
}
.circle-wrapper::before {
  position: absolute;
  content: "";
  height: 100%;
  width: 100%;
  left: 0;
  top: 0;
  border: 1px solid #5EDCD4;
  border-radius: 50%;
  -webkit-transform: scale(1.2);
  -ms-transform: scale(1.2);
  transform: scale(1.2);
  opacity: 0.3;
}
