    height: 250px;
    width: 250px;
  }
  .circle-wrapper::before {
    height: 100%;
    width: 100%;
    -webkit-transform: scale(1.2);
    -ms-transform: scale(1.2);
    transform: scale(1.2);
  }
}
@media (min-width: 1140px) {
  .circle-wrapper::before {
    -webkit-transform: scale(1.5);
    -ms-transform: scale(1.5);
    transform: scale(1.5);
  }
}
@media (min-width: 1440px) {
  .circle-wrapper {
    height: 350px;
    width: 350px;
  }
  .circle-wrapper::before {
    -webkit-transform: scale(1.8);
